import Link from 'next/link';

export default function Navbar() {
    return (
        <div>
            <Link href="/about" className="navbar">
                <a title="About Page" >About Page</a>
            </Link>
            <Link href="/Donations" className="navbar">
                <a title="Donations">Donations</a>
            </Link>

            <style jsx>{`
                .navbar {
                padding: 10px 15px;
                text-transform: uppercase;
                text-align: center;
                display: block;
            }
            `}</style>
        </div>

    )
}
